<script>

function confirmarAsi(){
  let r = confirm("Desea confirmar Su asistencia..?")
  if(r){
    loadData()
    let id = localStorage.getItem("id")
    apiPostJsonCrud("update",{"id":id,"con":true},"invitados").then((r)=>{
      if(r.msg=="success"){
        //localStorage.setItem("confirmado",true)
        successDat()
        graciasMod() 
      }
    })
  }
}

function graciasMod(){
	document.getElementById("graciasMod").style.top = "30vh"
}
function closeUbi(){
	document.getElementById("graciasMod").style.top = "-50vh"

  document.getElementById("confirma").classList.add("hiden")
  document.getElementById("gracias").classList.remove("hiden")
  document.getElementById("nom").textContent = storage("nom")
}

function init_m(){
  if(storage("confirmado")=="true"){
    document.getElementById("confirma").classList.add("hiden")
    document.getElementById("gracias").classList.remove("hiden")
    document.getElementById("nom").textContent = storage("nom")
  }
  localStorage.setItem("confirmado","")
  //graciasMod() 
}
</script>
